script: |
  super -f text -I q12965.spq | sort > q12965.out

inputs:
  - name: q12965.spq
    data: |
      SELECT DISTINCT + col0 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 BETWEEN NULL AND + col0 + 36 + col1 * + - col2 * - - 56;
  - name: tab0

outputs:
  - name: q12965.out
    data: |
      15
      87
      97
